import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <div className="footer">
      <div className="footer__social">Here will go Socila Media</div>
      <div className="footer__nav">
        <div className="footer__navLeft">
          <h3>Left Footer</h3>
          <div className="footer__links">
            <a href="">Link1</a>
            <a href="">Link1</a>
            <a href="">Link1</a>
          </div>
        </div>
        <div className="footer__navCenter">
          <h3>Center Footer</h3>
        </div>
        <div className="footer__navRight">
          <h3>Right Footer</h3>
        </div>
      </div>
    </div>
  );
}

export default Footer;
